import React, { Component } from "react";
import './App.css';
import Navbar from './Navbar'

class App extends Component {
    //Our React Code Goes in here!
    render() {
        return (
            < div className='text-center' style={{ color: 'green' }}>
                <h1>Hello World</h1>
            </div >
        )
    }
}

export default App;
